import Nav from './components/Nav'
import Home from './pages/Home'

import { RouterBrowser, Router, Route, BrowserRouter } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
        <Router>
          <Route 
            path="/"
            render={<Home/>}
          />
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
